'''Jiminua's Jungle Store''' is a [[general store]] that sells many useful items for those adventuring in the [[Karamja]]n jungle, such as [[antipoison]], [[pickaxe]]s, [[machete]]s, and [[axe]]s. It is also notable for being one of the few places to obtain both [[charcoal]] and [[papyrus]].

Some players use this store when crafting [[nature rune]]s, since [[Jiminua]] will effectively unnote their pure essence for a small fee. Because of the items it stocks, this shop is useful for the nearby minigame [[Tai Bwo Wannai Cleanup]].

